import base64
from io import BytesIO
from PIL import ImageFont
import os
import sys

def get_embedded_font(size=22):
    """Load embedded font with multiple fallback methods for EXE compatibility"""
    
    # Method 1: Try embedded font bytes (if available)
    try:
        if 'FONT_BYTES' in globals():
            font_data = base64.b64decode(FONT_BYTES)
            return ImageFont.truetype(BytesIO(font_data), size)
    except Exception:
        pass
    
    # Method 2: Try bundled font files (EXE mode) - ENHANCED FOR BETTER EXE COMPATIBILITY
    if getattr(sys, 'frozen', False):
        # Try multiple paths in EXE mode
        exe_font_paths = [
            os.path.join(sys._MEIPASS, 'assets', 'arialbd.ttf'),
            os.path.join(sys._MEIPASS, 'assets', 'arial.ttf'),
            os.path.join(sys._MEIPASS, 'arialbd.ttf'),
            os.path.join(sys._MEIPASS, 'arial.ttf'),
            os.path.join(os.path.dirname(sys.executable), 'assets', 'arialbd.ttf'),
            os.path.join(os.path.dirname(sys.executable), 'assets', 'arial.ttf'),
            os.path.join(os.path.dirname(sys.executable), 'arialbd.ttf'),
            os.path.join(os.path.dirname(sys.executable), 'arial.ttf'),
        ]
        
        for font_path in exe_font_paths:
            try:
                if os.path.exists(font_path):
                    return ImageFont.truetype(font_path, size)
            except Exception:
                continue
    
    # Method 3: Try local assets folder (development mode)
    dev_font_paths = [
        os.path.join('assets', 'arialbd.ttf'),
        os.path.join('assets', 'arial.ttf'),
        'arialbd.ttf',
        'arial.ttf'
    ]
    
    for font_path in dev_font_paths:
        try:
            if os.path.exists(font_path):
                return ImageFont.truetype(font_path, size)
        except Exception:
            continue
    
    # Method 4: Try system fonts with enhanced paths
    system_fonts = [
        'Arial Bold',
        'Arial-Bold', 
        'ArialMT-Bold',
        'Arial',
        '/System/Library/Fonts/Arial Bold.ttf',  # macOS
        '/System/Library/Fonts/Arial.ttf',       # macOS
        'C:\\Windows\\Fonts\\arialbd.ttf',       # Windows
        'C:\\Windows\\Fonts\\arial.ttf',         # Windows
        '/usr/share/fonts/truetype/dejavu/DejaVuSans-Bold.ttf',  # Linux
        '/usr/share/fonts/truetype/dejavu/DejaVuSans.ttf'        # Linux
    ]
    
    for font_name in system_fonts:
        try:
            return ImageFont.truetype(font_name, size)
        except Exception:
            continue
    
    # Method 5: Fallback to default with size adjustment
    try:
        default_font = ImageFont.load_default()
        # Try to create a larger default font if possible
        return default_font
    except Exception:
        # Ultimate fallback
        return ImageFont.load_default()

